import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Login from './components/pages/Login';

const App = () => {
  return (

    <Router>
      <div>
        <Switch>
          <Route path='/login'>
            <Login />
          </Route>
        </Switch>
      </div>
    </Router>

  )
}

export default App
